import React from 'react';
import './App.css';
import Nav from './components/Nav';
import Map from './components/Map';
import MainPollinationGraphs from './components/MainPollinationGraphs'
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';

function App() {

  return (
    <Router>
    <div className='app'>
      <Nav />
      <Switch>
      <Route path='/graphs' component={MainPollinationGraphs} />
      <Route path='/map' component={Map} />
      </Switch>
    </div>
    </Router>
  );
}
export default App;
